import React from "react";
import ContentBox from './ContentBox.js';
import './Boxes.css'

function Boxes() {
  const repositories = [
    {
      boxName: "Matemáticas",
      boxUrl: "https://www.youtube.com/watch?v=0MQly46xEuk",
      levels: [
        {
          name: "Sétimo",
          topics: [
            { name: "Números Naturales", subtopics: ["Suma", "Resta", "Multiplicación", "División", "Potencias"] },
            { name: "Combinación de operaciones", subtopics: [] },
            { name: "Teoría de números", subtopics: ["Algoritmo de la división", "Divisibilidad", "Factor", "Múltiplo", "Números primos", "Números compuestos", "Descomposición prima", "Mínimo Común Múltiplo", "Máximo Común Divisor"] },
            { name: "Números enteros", subtopics: ["Enteros negativos", "Concepto de número entero", "Relaciones de orden", "Recta numérica", "Valor absoluto", "Número opuesto"] },
            { name: "Operaciones cálculos y estimaciones", subtopics: ["Suma", "Resta", "Multiplicación", "División", "Potencias", "Raíces", "Combinación de operaciones"] },
          ],
        },
        {
          name: "Octavo",
          topics: [
            { name: "Números racionales", subtopics: ["Concepto de número racional", "Representaciones", "Relaciones de orden"] },
            { name: "Operaciones cálculos y estimaciones", subtopics: ["Suma", "Resta", "Multiplicación", "División", "Potencias", "Raíces", "Combinación de operaciones"] },
          ],
        },
        {
          name: "Noveno",
          topics: [
            { name: "Números reales", subtopics: ["Números irracionales", "Concepto de número real", "Representaciones", "Comparación", "Relaciones de orden", "Recta numérica"] },
            { name: "Cálculos y estimaciones", subtopics: ["Suma", "Resta", "Multiplicación", "División", "Potencias", "Radicales"] },
            { name: "Cantidades muy grandes y muy pequeñas", subtopics: [] },
          ],
        },
        // ... otros niveles y temas según el PDF ...
      ],
    },
    // ... otras cajas si son necesarias ...
  ];

  return (
    <div className="boxes_containers">
      {repositories.map((box, index) => (
        <ContentBox key={index} repoName={box.boxName} repoUrl={box.boxUrl} levels={box.levels} />
      ))}
    </div>
  );
}

export default Boxes;
